webpackJsonp([61038181523474],{8286:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Northwest pilots agree wage cuts",date:"04 May 2006",slug:"/2006-05-04-northwest-pilots-agree-wage-cuts/",tags:"Y2006"},html:'<p><a href="http://news.bbc.co.uk/1/hi/business/4971164.stm" title="BBC NEWS | Business | Northwest pilots agree wage cuts">BBC NEWS: Northwest pilots agree wage cuts</a>: "Northwest Airlines\' pilots have voted to accept a contract that will cut their pay by 24%, a move the firm said is key to it emerging from bankruptcy." Which is good, since we\'ve got non-refundable tickets to fly Northwest to Minnesota in August (although we actually bought the tickets from KLM, which is not bankrupt).</p>\n<p>(And is it just British English, or is the BBC cutting back on prepositions in its headlines?)</p>'},next:{fields:{title:"No Denglish",date:"04 May 2006",slug:"/2006-05-04-no-denglish/"}},previous:{fields:{title:"Web 2.1 server-side blink tag",date:"04 May 2006",slug:"/2006-05-04-web-21-server-side-blink-tag/"}}},{node:{fields:{title:"No Denglish",date:"04 May 2006",slug:"/2006-05-04-no-denglish/",tags:"Y2006"},html:'<p>ChicagoKarl notes the <a href="http://chicagokarl.de/2006/05/german-articles-for-english-words" title="ChicagoKarl &raquo; Blog Archive &raquo; German Articles for English Words">prevelence of English jargon</a> in the German language, especially in IT. I think German would be a lot easier without any English words, because</p>\n<ol>\n<li>I don\'t which article to use with them</li>\n<li>I don\'t konw how to pronounce them (correct English or phonetic German)</li>\n<li>They don\'t always mean what you think they mean (i.e. <a href="http://dict.leo.org/ende?searchLoc=1&amp;searchLocRelinked=1&amp;lp=ende&amp;search=handy&amp;lp=ende&amp;lang=de&amp;searchLoc=0&amp;searchLocRelinked=1&amp;search=">"handy"</a> doesn\'t mean adept, and <a href="http://dict.leo.org/ende?lp=ende&amp;lang=de&amp;searchLoc=1&amp;cmpType=relaxed&amp;sectHdr=on&amp;spellToler=on&amp;search=pullover&amp;relink=on">"pullover"</a> has nothing to do with the wool over your eyes)</li>\n</ol>\n<p>I don\'t worry about it much though. I haven\'t had any angst of foreign languages since I had a blitz course in French back in kindergarten.</p>'},next:{fields:{title:"Bad Day Fishing",date:"03 May 2006",slug:"/2006-05-03-bad-day-fishing/"}},previous:{fields:{title:"Northwest pilots agree wage cuts",date:"04 May 2006",slug:"/2006-05-04-northwest-pilots-agree-wage-cuts/"}}},{node:{fields:{title:"Bad Day Fishing",date:"03 May 2006",slug:"/2006-05-03-bad-day-fishing/",tags:"Y2006"},html:"<p>There's a saying that a good day at work is never as good as a bad day fishing. But since a sys admin's  favorite task is deleting files, a day when I can reduce a file server from 134 GB to 90 GB is nearly as good as a bad day fishing. </p>"},next:{fields:{title:"Political Wisdom",date:"02 May 2006",slug:"/2006-05-02-political-wisdom/"}},previous:{fields:{title:"No Denglish",date:"04 May 2006",slug:"/2006-05-04-no-denglish/"}}}],pathPrefix:"",first:!1,last:!1,index:221,pageCount:1101}}}});
